import React from "react";
import {SoftwareContainer} from "./PageElements"
const Software = () => {
  return (
    <SoftwareContainer>
      <div style={{ display: "flex", textAlign: "center" }}>
        <div style={{float: "left"}}>
        <h1>Front-End Dev</h1>
        <p> JavaScript | TypeScript | HTML | CSS</p>
        </div>
        <div style={{float: "right", flex: 1}}>
          <h1>Back-End Dev</h1>
          <p>Java | Python | C++ </p>
        </div>
      </div>

      <h1 style={{ textAlign: "center" }}>Mentorship</h1>
      <h1 style={{ paddingLeft: "3.3em" }}>Projects</h1>
    </SoftwareContainer>
  );
};

export default Software;
